import React from 'react';
import './PopUp.css';

const PopUp = (props) => {
    return (props.trigger) ? (
        <div className='popup'>
            <div className='popup-inner'>
                <button className='btnClose'></button>
                {props.children}
            </div>
        </div>

    ) : "";

};

export default PopUp;
